import React from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate()

  const handleLogout = () => {
    alert()
    navigate('/')
  }

  return (
    <div>
      <h1>Dashboard</h1>

      <div onClick={handleLogout}>
      <p>logout</p>
      </div>
    </div>
  );
};

export default Dashboard;
